select * From[dbo].[sales_data]
-------HIGHEST SELLING PRODUCT----

SELECT product, SUM(quantity) AS total_sales
FROM sales_data
GROUP BY product
ORDER BY total_sales DESC

--------Top 5 Customers by Total Purchase Amount----

SELECT Customer_id, SUM(sale_of_product) AS Total_Purchase_Amount
FROM sales_data
GROUP BY Customer_id
ORDER BY Total_Purchase_Amount DESC

--------Calculate Monthly Sales----
SELECT MONTH, SUM(sale_of_product) AS Monthly_Sales
FROM sales_data
GROUP BY MONTH
ORDER BY MONTH;

---- Calculate Total Revenue per Product----

SELECT Product, SUM(sale_of_product) AS Total_Revenue
FROM sales_data
GROUP BY Product;

 ----the Highest Selling Product---

SELECT Product, SUM(Quantity) AS Total_Sold
FROM sales_data
GROUP BY Product
ORDER BY Total_Sold DESC

----the Number of Sales Transactions in Each Region----

SELECT Region, COUNT(*) AS Number_of_Transactions
FROM sales_data
GROUP BY Region;

----Percentage of Total Sales Contributed by Each Region----
SELECT 
    Region,
    SUM(sale_of_product) AS Region_Sales,
    (SUM(sale_of_product) / (SELECT SUM(sale_of_product) FROM sales_data) * 100) AS Sales_Percentage
FROM sales_data
GROUP BY Region;

-----Identify Products with No Sales in the Last Quarter----
SELECT Product
FROM sales_data
WHERE MONTH NOT IN ('October-23', 'November-23', 'December-23')
GROUP BY Product


