CREATE TABLE Customer_Subscriptions (
    SubscriptionID INT IDENTITY(1,1) PRIMARY KEY,  -- Auto-incrementing primary key
    CustomerID VARCHAR(10),
	customer_name varchar (50),
	region VARCHAR(50),
    SubscriptionType VARCHAR(50),
    SubscriptionStart DATE,
    SubscriptionEnd DATE,
    Canceled BIT,  -- BIT type to store boolean values
    Revenue VARCHAR(255),
    FOREIGN KEY (CustomerID) REFERENCES CustomerData(CustomerID)
	);


	alter table [dbo].[CustomerSubscriptions]
	add customer_name varchar (50)

	alter table [dbo].[CustomerSubscriptions]
	add region VARCHAR(50)


	UPDATE[dbo].[CustomerSubscriptions]
Set Revenue  = AS NUMERIc
WHERE CustomerID = ('201','202','203','204','205','206','207','208','209','210','211','212','213','214','215','216','217','218','219','220')



	UPDATE CustomerSubscriptions
SET SubscriptionStart = TRY_CAST(SubscriptionStart AS DATE),
    SubscriptionEnd = TRY_CAST(SubscriptionEnd AS DATE)


	UPDATE CustomerSubscriptions
SET Revenue = CAST(REPLACE(Revenue, ',','',) AS DECIMAL(10, 2)
where CustomerID=('201','202','203','204','205','206','207','208','209','210','211','212','213','214','215','216','217','218','219','220')

ALTER TABLE [dbo].[CustomerSubscriptions]
ALTER COLUMN Revenue VARCHAR(255);

