select * from[dbo].[Customer_Subscriptions]

-------Total Number of Customers from Each Region

SELECT Region, COUNT(CustomerID) AS TotalCustomers
FROM [dbo].[Customer_Subscriptions]
GROUP BY region;

------Most Popular Subscription Type by the Number of Customers

SELECT SubscriptionType, COUNT(CustomerID) AS NumberOfCustomers
FROM [dbo].[Customer_Subscriptions]
GROUP BY SubscriptionType
ORDER BY NumberOfCustomers DESC


-----Customers Who Canceled Their Subscription Within 6 Months

SELECT CustomerID, SubscriptionType, SubscriptionStart, SubscriptionEnd
FROM [dbo].[Customer_Subscriptions]
WHERE Canceled = 1 
  AND DATEDIFF( SubscriptionStart, SubscriptionEnd) <= 6;



 -----Find the Total Number of Active and Canceled Subscriptions

 SELECT 
    Canceled,
    COUNT(CustomerID) AS TotalSubscriptions
FROM [dbo].[Customer_Subscriptions]
GROUP BY Canceled;

-------Customers Who Canceled Their Subscription Within 6 Months

. Find Customers Who Canceled Their Subscription Within 6 Mont
SELECT CustomerID, SubscriptionType, SubscriptionStart, SubscriptionEnd
FROM [dbo].[Customer_Subscriptions]
WHERE Canceled = 1 
  AND DATEDIFF(MONTH, CONVERT(DATE, SubscriptionStart, 12), CONVERT(DATE, SubscriptionEnd, 12)) <= 6;


  ------Calculate the Average Subscription Duration for All Customers

  SELECT AVG(DATEDIFF(MONTH, CONVERT(DATE, SubscriptionStart, 12), CONVERT(DATE, SubscriptionEnd, 12))) AS AvgSubscriptionDuration
FROM [dbo].[Customer_Subscriptions]


------ Find the Top 3 Regions by Subscription Cancellations

SELECT Region, COUNT(CustomerID) AS Cancellations
FROM [dbo].[Customer_Subscriptions]
WHERE Canceled = 1
GROUP BY Region
ORDER BY Cancellations DESC


SELECT CustomerID, SubscriptionType, SubscriptionStart, SubscriptionEnd
FROM [dbo].[Customer_Subscriptions]
WHERE DATEDIFF(MONTH, CONVERT(DATE, SubscriptionStart, 12), CONVERT(DATE, SubscriptionEnd, 12)) > 12;